import React from "react";

const Project = ({ href, imgSrc, p }) => {
  return (
    <>
      <a href={href} target="_blank" class="project project-tile">
        <img class="project-image" src={imgSrc} alt="project" />
        <p class="project-title">{p}</p>
      </a>
    </>
  );
};

export default Project;
